sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code == '200' && inputs.response) {
        try {
            var xmlDoc = new XMLDocument2();
    	    xmlDoc.parseXML(inputs.response);
            var responseStatus = xmlDoc.getNode(
                "/s:Envelope/s:Body/m:GetItemResponse/m:ResponseMessages/m:GetItemResponseMessage"
            ).getAttribute('ResponseClass');
             if (responseStatus === 'Success') {
                outputs.status = "Success";
                var path="/s:Envelope/s:Body/m:GetItemResponse/m:ResponseMessages/m:GetItemResponseMessage/m:Items/t:CalendarItem";
                var node=xmlDoc.getNode(path);
                var iter=node.getChildNodeIterator();
                outputs.is_deleted = false;
                while(iter.hasNext()) {
                    var childNode=iter.next();

                  	if(childNode.getNodeName()==="t:Attachments") {
                      	outputs.has_attachments="true";
                        var attachments=[];
                        var attachments_json=gs.xmlToJSON(childNode.toString());
                      	if (Array.isArray(attachments_json["t:Attachments"]["t:FileAttachment"])) {
                            var fileAttachments=attachments_json["t:Attachments"]["t:FileAttachment"];
                            for(var i=0;i<fileAttachments.length;i++) {
                                attachments.push(fileAttachments[i]["t:AttachmentId"]["Id"]);
                            }
                        }
                        else {
                            attachments.push(attachments_json["t:Attachments"]["t:FileAttachment"]["t:AttachmentId"]["Id"]);
                        }
                        outputs.attachments=attachments;
                    }

                    if(childNode.getNodeName()==="t:Subject") {
                        outputs.subject = childNode.getTextContent();
                    }

                    if(childNode.getNodeName()==="t:Start") {
                        var dateTime = childNode.getTextContent();
                        var gdt = new GlideDateTime(dateTime);
                        outputs.start_time = gdt.getDisplayValue();
                    }

                    if(childNode.getNodeName()==="t:End") {
                        var dateTime = childNode.getTextContent();
                        var gdt = new GlideDateTime(dateTime);
                        outputs.end_time = gdt.getDisplayValue();
                    }

                    if(childNode.getNodeName()==="t:Location") {
                        outputs.location = childNode.getTextContent();
                    }

                    if(childNode.getNodeName()==="t:Organizer") {
                        var organizer_json=gs.xmlToJSON(childNode.toString());
                        outputs.organizer_email=organizer_json["t:Organizer"]["t:Mailbox"]["t:EmailAddress"];
                    }

                    if(childNode.getNodeName()==="t:Body") {
                        outputs.body = childNode.getTextContent();
                    }

                    if(childNode.getNodeName()==="t:RequiredAttendees") {
                        var requiredAttendees = [];
                        var required_attendees_json=gs.xmlToJSON(childNode.toString());

                        if (Array.isArray(required_attendees_json["t:RequiredAttendees"]["t:Attendee"])) {
                            var attendees = required_attendees_json["t:RequiredAttendees"]["t:Attendee"];
                            for (var i = 0; i < attendees.length; i++) {
                                var responseType = attendees[i]["t:ResponseType"];
                                if(responseType=="Unknown") {
                                  responseType="Not Responded";
                                }
                                var required_attendee = {};
                                required_attendee.response_type = responseType;
                                var mailbox = attendees[i]["t:Mailbox"]
                                if (mailbox["t:EmailAddress"]) {
                                    required_attendee.email_address = mailbox["t:EmailAddress"];
                                }
                                requiredAttendees.push(required_attendee);
                            }
                        } else {
                            var attendee = required_attendees_json["t:RequiredAttendees"]["t:Attendee"];
                            var mailbox = attendee["t:Mailbox"];
                            var required_attendee = {};
                            if(attendee["t:ResponseType"]=="Unknown") {
                              required_attendee.response_type="Not Responded";
                            }
                            else {
                                required_attendee.response_type = attendee["t:ResponseType"];
                            }
                            if (mailbox["t:EmailAddress"]) {
                                required_attendee.email_address = mailbox["t:EmailAddress"];
                            }
                            requiredAttendees.push(required_attendee);
                        }

                      outputs.required_attendees = requiredAttendees;
                    }
                }

            } else {
                var jsonFormat = gs.xmlToJSON(inputs.response);
                var response = jsonFormat["s:Envelope"]["s:Body"]["m:GetItemResponse"]["m:ResponseMessages"]["m:GetItemResponseMessage"];
                var responseCode = response["m:ResponseCode"];
                if (responseCode == "ErrorItemNotFound") {
                    outputs.is_deleted = true;
                    outputs.status = "Success";
                }
                else {
                  outputs = new ExchangeErrorHandler().getCalendarEvent(inputs, outputs);
                }
            }
        } catch (e) {
            outputs = new ExchangeErrorHandler().getCalendarEvent(inputs, outputs);
        }
    } else
        outputs = new ExchangeErrorHandler().getCalendarEvent(
            inputs, outputs);
  })(inputs, outputs);

